  const [analyticsResult, setAnalyticsResult] = useState<PerformanceMetrics | null>(null);
  const [analyzing, setAnalyzing] = useState(false);
  const [modelConfig, setModelConfig] = useState<ModelConfig>({
      temperature: 0.7,
      topP: 0.95,
      topK: 40
  });

